import React from 'react'
import { CarouselProvider, Slider, Slide, ButtonBack, ButtonNext, Dot } from 'pure-react-carousel';
import useStyles from './CarouselElement'
import 'pure-react-carousel/dist/react-carousel.es.css'
import img from './../../videos/c.svg'
import img1 from './../../videos/b.svg'
import img2 from './../../videos/a.svg'
import { Box, Grid } from '@material-ui/core';
const Carousels = () => {
    const classes = useStyles()

    return (

        <Box>
        <CarouselProvider
        infinite={true}
        visibleSlides={3}
        isPlaying={true}
        interval={5000}
        naturalSlideWidth={100}
        naturalSlideHeight={100}
        totalSlides={5}

      >
     <Grid container>
           <Slider>

          <Slide index={0}>
              <img className={classes.img} src={img} />
          </Slide>
          <Slide index={1}> <img className={classes.img} src={img1} /></Slide>
          <Slide index={2}> <img className={classes.img} src={img2} /></Slide>
          <Slide index={3}> <img className={classes.img} src={img1} /></Slide>
          <Slide index={4}> <img className={classes.img} src={img2} /></Slide>
        </Slider>
        </Grid>
      </CarouselProvider>
        </Box>
    )
}

export default Carousels
